INSERT INTO `produk` (`id_produk`, `id_user`, `kode_produk`, `nama_produk`, `id_menu`, `kategori_produk`, `harga`, `berat_kotor`, `berat_bersih`, `stok_produk`, `ket`, `deskripsi`, `foto_produk1`, `foto_produk2`, `foto_produk3`, `jumlah_stok`, `jumlah_terjual`, `provinsi`, `kota`, `validasi`, `pajak`) VALUES (2004280004,'Admin','H222','Sayur Kol (1 kg)',1,6,13500,1100,1000,'Ada','','Kubis atau kol merupakan salah satu jenis sayuran yang cukup akrab di lidah masyarakat Indonesia. Memiliki tekstur renyah dan rasa yang ringan. Karena itulah, sayuran yang memiliki nama ilmiah Brassica oleracea var. capitata ini sering diolah menjadi beragam hidangan lezat; seperti sup, bakwan, hingga siomay.','sayurkol.jpg','','',70,17,11,255,1,0),(2004280005,'Admin','','Eden Farm Oyong (500 g)',1,6,6400,0,0,'','','Gambas atau oyong (Luffa acutangula, suku labu-labuan atau Cucurbitaceae), adalah komoditas sayuran minor. Penanamannya biasanya dilakukan di pekarangan atau bagian ladang yang tidak digunakan untuk tanaman lain. Gambas dipanen buahnya ketika masih muda dan diolah sebagai sayur.','oyong.jpg','','',100,0,11,255,1,0),(2004280006,'Admin','','Selada Keriting Hijau (500 g)',1,6,10000,0,0,'Kosong','','Selada Keriting Hijau Dapat ditanam di dataran rendah sampai tinggi. Merupakan jenis tanaman sayuran dengan bentuk daun bergelombang berwarna hijau kekuningan. Tekstur daun renyah dan tahan penyakit busuk lunak. Selada sering dikonsumsi mentah sebagai lalapan maupun sebagai bahan pelengkap masakan lain. Umur panen  45 hari setelah pindah tanam. Kebutuhan benih 160  200 g/Ha.','seladakeriting.jpg','','',99,1,11,255,1,0),(2004280007,'Admin','','Labu Siam Besar (1 kg)',1,6,6000,0,0,'','','Labu siam atau jipang (Sechium edule, bahasa Inggris: chayote) adalah tumbuhan suku labu-labuan (Cucurbitaceae) yang dapat dimakan buah dan pucuk mudanya. Tumbuhan ini merambat di tanah atau agak memanjat dan biasa dibudidayakan di pekarangan, biasanya di dekat kolam. Buah menggantung dari tangkai. Daunnya berbentuk mirip segitiga dan permukaannya berbulu.','labusiam.jpg','','',100,0,11,255,1,0),(2004280008,'Admin','','Tomat (500 g)',1,6,7500,0,0,'Kosong','','Tomat (Solanum lycopersicum syn. Lycopersicum esculentum) adalah tumbuhan dari keluarga Solanaceae, tumbuhan asli Amerika Tengah dan Selatan, dari Meksiko sampai Peru. Tomat merupakan tumbuhan siklus hidup singkat, dapat tumbuh setinggi 1 sampai 3 meter. Tumbuhan ini memiliki buah berawarna hijau, kuning, dan merah yang biasa dipakai sebagai sayur dalam masakan atau dimakan secara langsung tanpa diproses. Tomat memiliki batang dan daun yang tidak dapat dikonsumsi karena masih sekeluarga dengan kentang dan Terung yang mengadung Alkaloid.','tomat.jpg','','',100,0,11,255,1,0),(2004280009,'Admin','','Bumbu Racik Nasi Goreng [20 g]',1,7,2125,0,0,'','','Sekarang ini urusan dapur pun jadi serba mudah dan praktis karena tidak sedikit ibu memilih masak dengan menggunakan bumbu instan. Terlepas dari aman atau tidaknya cara ini yang jelas proses memasak jelas akan lebih cepat dan ekonomis. Adapun soal rasa juga tidak jauh beda dengan bumbu racikan sendiri, bahkan ada yang menyebutkan jika memasak dengan bumbu instan itu jauh lebih gurih dan berasa.\r\n','bumburacik.jpg','','',0,100,11,255,1,0),(2004280010,'Admin','','Lengkuas Bubuk Bumbu Masak [22 g]\r\n',1,7,3000,0,0,'','','Koepoe-koepoe Lengkuas Bubuk Bumbu Masak Instan [22 g], bumbu masak instan yang diproses dan dikemas secara higienis serta tidak mengandung pengawet sehingga dapat bertahan lama. Ideal untuk melengkapi bumbu dapur Anda.\r\n','lengkuasbubuk.jpg','','',99,1,11,255,1,0),(2004280011,'Admin','','Lada Putih Bubuk Bumbu Masak [38 g]\r\n',1,7,10000,0,0,'','','Selain dikenal karena kearifan lokalnya ternyata Indonesia juga diperkaya dengan rempah-rempah, serta bumbu-bumbu khas nusantara yang disiap membuat olahan masakan menjadi semakin lezat dan sedap. Karena hal itu, banyak orang berbondong-bondong datang ke tanah air agar bisa mendapatkan rempah-rempah asli Indonesia. Ada banyak macam bumbu yang tentu sering dijadikan resep andalan untuk memasak, seperti halnya Bawang Merah, Bawang Putih, Jahe, Pala, Merica, Kencur, Kunyit, Cengkeh, Lada, Lengkuas, Cabai, Asam Jawa, Kemiri, Kayu Manis, Santan Kelapa, dll. Yang semua jenis bumbu dapur itu belum tentu ditemukan di luar Indonesia.\r\n','ladaputihbubuk.jpg','','',100,0,11,255,1,0),(2004280012,'Admin','','Kencur Super Bumbu Dapur [1 kg]\r\n',1,7,90000,0,0,'Kosong','','Kencur Super Bumbu Dapur [1 kg] adalah salah satu jenis bumbu dapur yang memiliki aroma khas yang segar dan menyeruak. Selain digunakan sebagai penambah cita rasa dalam masakan, manfaat kencur juga sudah lama dikenal sebagai obat alami. Netto 1 kg.\r\n','kencursuperbumbudapur.jpg','','',100,0,11,255,1,0),(2004280013,'Admin','','Italian Grill Bumbu Peredam Daging Khas Italia\r\n',1,7,12500,0,0,'Kosong','','Jay\'s Kitchen Grillmaster Italian Grill Bumbu Peredam Daging Khas Italia merupakan bumbu perendam barbeque dengan paduan bahan  bawang putih, bawang bombay, dan paprika dengan sentuhan rempah-rempah. Cocok untuk semua jenis daging sapi, ayam, dan seafood. Dikemas dalam kemasan yang praktis, Anda kini dapat menyajikan masakan favorit Anda hanya dalam waktu 10 menit. Jay\'s Grill Master dibuat dari bahan-bahan pilihan tanpa MSG, yang tentunya membuat hidangan barbeque Anda lezat.\r\n','italiangrillbumbuperedamdagingkhasitalia.jpg','','',100,0,11,255,1,0),(2004280014,'Admin','','Bagelen Sisir Kue Kering [125 g]\r\n',1,8,15500,0,0,'','','Moessy Snack Bagelen Sisir Kue Kering [125 g], kue kering yang terbuat dari bahan pilihan dan berkualitas. Bentuknya lucu, seperti roti tawar dalam bentuk mini. Rasa manis harum enak, gurih, renyah dan nikmat. Sangat cocok untuk acara santai bersama teman dan keluarga. Sudah terdapat ijin PIRT, merk terdaftar.\r\n','BagelenSisirKueKering.jpg','','',99,1,11,255,1,0),(2004280015,'Admin','','Pang Pang Makanan Ringan [500 g]\r\n',1,8,25000,0,0,'','','Juara Snack Pang Pang Makanan Ringan [500 g] merupakan pang-pang atau disebut sebagai kue bantal, memiliki ukuran yang kecil dengan rasa yang enak, gurih dan renyah. Pang Pang dibuat dengan cara digoreng. Snack ini sangat disukai oleh masyarakat di Indonesia. Dikemas dengan plastik zipper sehingga mutunya tetap terjaga dengan baik.\r\n','PangPangMakananRingan.jpg','','',100,0,11,255,1,0),(2004280016,'Admin','','Rasa Vanilla Cemilan Kuping Gajah Kue Kering [75 g/ Mini]\r\n',1,8,16000,0,0,'','','Josh Food Rasa Vanilla Cemilan Kuping Gajah Kue Kering [75 g/ Mini] merupakan salah satu makanan kering khas Indonesia yang banyak digemari oleh berbagai kalangan. Cemilan dengan nama yang unik ini memiliki rasa yang khas dan begitu nikmat ketika disantap. Kue kuping gajah bisa dinikmati sewaktu santai bersama dengan keluarga atau menjadi cemilan sewaktu menonton televisi. Cemilan yang telah ada sejak dahulu ini telah dihadirkan dengan inovasi baru yang tidak membosankan, yaitu Josh Food Cemilan Kuping Gajah Mini. Varian Rasa yang Menggugah Selera Cemilan tradisional khas Indonesia ini hadir dengan berbagai varian rasa yang menggugah selera, yakni pandan, strawberry, durian, blueberry, cokelat, vanilla, moka dan teh hijau. Memiliki bentuk mini atau bite size menjadikannya semakin terlihat unik. Sementara pembuatannya diproses secara higienis dengan standard mutu dan kualitas terbaik. Kini saatnya sebarkan cinta akan cemilan tradisional dengan sentuhan modern serta rasakan ke ajaiban di setiap gigitan kuping gajah mini josh.\r\n','RasaVanillaKupingGajahKueKering.jpg','','',96,4,11,255,1,0),(2004280017,'Admin','','Gatito Kue Lidah Kucing Sandwich Cokelat [10 Sachet/ Kotak]\r\n',1,8,19000,0,0,'','','Gatito merupkan brand makanan ringan berupa kue lidah kucing sandwich pasta cokelat. Dikemas 1 kotak berisi 10 sachet dgn netto 32gr/sachet. Produksi PT. Kaldu Nabati Sari - Bandung, perusahaan multi konsumen produk yang merajai pasar lokal khususnya jawa barat hingga terkenal se nusantara. Nabati sebenarnya sudah sangat merambah lini jualan yang beragam. Mulai dari snack yang utama hingga konsorsium pemilik brand snack sarat penghargaan bergensi nasional hingga jaringan resto. Dan salah satu produk yang mereka punya adalah Gatito.\r\n','GatitoKueLidahKucingSandwichCoklat.jpg','','',100,0,11,255,1,0),(2004280018,'Admin','','Blackmond Camilan Sehat\r\n',1,8,37500,0,0,'','','Ladang Lima Blackmond Camilan Sehat, Cemilan sehat tanpa rasa bersalah. Kue kering bebas gluten, perpaduan dark coklat dan kacang almond, buat kamu yang pengen cemilan sehat. \r\n','BlackmondCamilanSehat.jpg','','',98,3,11,255,0,0),(2004280019,'Admin','','Boss Topi Wanita\r\n',1,9,650000,0,0,'','','Import Fashion Boss Topi Wanita merupakan topi yang terbuat dari bahan berkualitas yang didesain trendy dengan embroidery pada bagian depan dan adjustrable strap pada bagian belakang sehingga dapat disesuaikan dengan ukuran kepala Anda. Diameter 19cm. Dimensi : 28 x 14 x 15 cm\r\n','BossTopiWanita.jpg','','',100,0,11,255,0,0),(2004280020,'Admin','','Tas Ransel Wanita\r\n',1,9,55000,0,0,'','','Tas Ransel Wanita merupakan backpack berbahan kulit sintetis yang didesain trendy. Kompartemen utama berdetail resleting, inner zipper pockets, front pocket, side pockets, handle strap, dan adjustable shoulder strap. Tas bisa digunakan sebagai backpack ataupun shoulder bag. Dimensi : 26 x 14 x 34 cm.\r\n','TasRanselWanita.jpg','','',100,0,11,255,0,0),(2004280021,'Admin','','Casual Sepatu Slip On Pria\r\n',1,9,185000,0,0,'Kosong','','Fashion Casual Sepatu Slip On Pria merupakan slip on shoes berbahan kanvas yang didesain trendy dengan detail neat stitching dan TPR outsole sehingga nyaman ketika digunakan.\r\n','CasualSepatuSlipOnPria.jpg','','',100,0,11,255,0,0),(2004280022,'Admin','','Tas Selempang Pria + Free Kabel USB\r\n',1,9,67500,0,0,'','','Fashion Tas Selempang Pria + Free Kabel USB, sling bag berbahan kulit sintetis (water resistant) yang didesain trendy dengan kompartemen utama berdetail zipper opening, front zipper pocket dan adjustable strap. Ukuran : 18 x 9 x 34 cm. Terdapat 2 port USB dan earphone. Free kabel port USB\r\n','TasSelempangPria+FreeKabelUSB.jpg','','',100,0,11,255,0,0),(2004280023,'Admin','','Polos Kaos Polo Pria\r\n',1,9,56000,0,0,'Kosong','','Polos Kaos Polo Pria merupakan short sleeves polo shirt berbahan lacost PE yang didesain trendy dengan pointed collar dan front half button opening, sehingga sangat nyaman pada saat digunakan.\r\n','PolosKaosPoloPria.jpg','','',100,0,11,255,0,0),(2004280024,'Admin','','Care Health Hand Sanitizer\r\n',1,10,45000,0,0,'Kosong','','Care Health Hand Sanitizer, hand sanitizer dengan kadar alkohol 70% jadi sangat efektif membunuh kuman, bakteri dan virus dibanding yg 65%. Walau kadar alkohol tinggi tidak membuat tangan kering, gatal-gatal karena mengandung pelembab. Lebih irit dibandingkan model spray, karna hanya butuh 5 tetes bisa untuk bilas tangan keseluruhan. Bentuknya gel yang mengandung pelembab, sehingga tidak membuat tangan Kering.\r\n','CareHealthHandSanitizer.jpg','','',100,0,11,255,0,0),(2004280025,'Admin','','Hazmat / APD / Alat Pelindung Diri / Coverall - Putih\r\n',1,10,300000,0,0,'Kosong','','ENVIDE Suit Protector yang merupakan produk solusi kesehatan. Bahan yang kami gunakan untuk memproduksi ENVIDE Suit Protector adalah 100% POLYESTER non WOVEN, penggunaan dan klasifikasi bahan tersebut diantaranya digunakan untuk perlengkapan medis dan kesehatan, pakaian bedah, pakaian pelindung dan kain disinfektan\r\n','AlatPelindungDiri.jpg','','',100,0,11,255,0,0),(2004280026,'Admin','','Face shield / APD covid-19\r\n',1,10,10000,0,0,'Kosong','','Dengan memegang masker tersebut khususnya melalui tangan yang kotor, maka risiko terjangkit penyakit pun semakin besar. Berbeda dengan face shield yang terpasang seperti topi di kepala kita, saat bergerak tidak akan menjadi masalah dan tetap nyaman. Kebiasaan menyentuh wajah pasti jadi terhalang juga lantaran bentuknya yang tidak memungkinkan untuk kita sentuh, katanya. Meski begitu, face shield lebih baik jika dipakai oleh tenaga medis dan mereka yang intensitas bertemu dengan banyak orangnya tinggi. Misalnya super bus atau kasir di pasar swalayan. Karena mereka yang paling berisiko untuk berbicara dengan orang sehingga lebih penting untuk memblokir penyebaran tetesan yang dapat mengenai wajah, katanya.\r\n','Faceshield.jpg','','',100,0,11,255,0,0),(2004280027,'Admin','','Health Care Car Air Ion Counter Tester\r\n',1,10,562000,0,0,'Kosong','','Health Care Car Air Ion Tester adalah alat untuk menguji ion negatif dan positif di suatu ruangan atau di mobil Anda. Memiliki bentuk yang kecil dan ringan.\r\n','HealthCareCarAirIonCounterTester.jpg','','',100,0,11,255,0,0),(2005080001,'Admin','1','AGEO-1134000159',1,9,1,1,0,'Ada','0',' -','foto_2005080001_1.jpg','','',1,NULL,11,255,0,0),(2005080002,'Admin','2','ANNABETH MPD-1314090190',1,9,1,1,0,'Ada','0',' -','foto_2005080002_1.jpg','','',1,NULL,11,255,0,0),(2005080003,'Admin','3','B508.1-6182020288',1,9,1,1,0,'Ada','0',' -','foto_2005080003_1.jpg','','',1,NULL,11,255,0,0),(2005080004,'Admin','4','BEATRICA-1313840170',1,9,1,1,0,'Ada','0',' -','foto_2005080004_1.jpg','','',1,NULL,11,255,0,0),(2005080005,'Admin','5','BO 1177 C JEANS HS STRIPES-2220350193',1,9,1,1,0,'Ada','0',' -','foto_2005080005_1.jpg','','',1,NULL,11,255,0,0),(2005080006,'Admin','6','CL 3660 JOGGER PWM-2520030963',1,9,1,1,0,'Ada','0',' -','foto_2005080006_1.jpg','','',1,NULL,11,255,0,0),(2005080007,'Admin','7','CL 3671 JOGGER HSHL-2520031132',1,9,1,1,0,'Ada','0',' -','foto_2005080007_1.jpg','','',1,NULL,11,255,0,0),(2005080008,'Admin','8','CLARINTA DRESS-6024510121',1,9,1,1,0,'Ada','0',' -','foto_2005080008_1.jpg','','',1,NULL,11,255,0,0),(2005080009,'Admin','9','CLARINTA DRESS-6024510143',1,9,1,1,0,'Ada','0',' ','foto_2005080009_1.jpg','','',1,NULL,11,255,0,0),(2005080010,'Admin','10','CODE MALE-4091040620',1,9,1,1,0,'Ada','0',' ','foto_2005080010_1.jpg','','',1,NULL,11,255,0,0),(2005080011,'Admin','11','CODE MALE-4091050158',